import React, { useState, useEffect } from 'react';
import Card from "./Card"
import "./card.css"

let DUMMY_EXPENSE = [];


const Data = () => {
    const [expenses, setExpenses] = useState(DUMMY_EXPENSE);

    let d = expenses;
    // console.log(d[0]);


    function fetchData() {
        fetch("https://s3-ap-southeast-1.amazonaws.com/he-public-data/studiod9c0baf.json").then(
            res => {
                return res.json();
            }
        ).then(
            data => {
                // console.log(data);
                setExpenses(data);
            }
        )
    }


    useEffect(() => {
        fetchData()
    }, []);


    const nData = (val) => {
        // console.log(val);
        <Card
            imgsrc={val.cover_image}
            song={val.song}
            artist={val.artists}
            link={val.url}
        />
    }




    return (
        <div>
            <h1 className='heading_style' >
                Home Page
            </h1>


            {d.map(nData)}


        </div>
    )
}


export default Data;
